import React from "react";

// sample data:
const data = [
    {inv_number : 12345678, cost: 1600.25, name: "M1 Macbook Air", model: "512 GB", wattage: 10, serial_number: 12315},
    {inv_number : 23456789, cost: 1200.00, name: "M1 Macbook Air", model: "128 GB", wattage: 10, serial_number: 12315},
    {inv_number : 45678901, cost: 1500.00, name: "M1 Macbook Air", model: "256 GB", wattage: 10, serial_number: 12315}
]

function Electronics() {
    return (
        <div class="container-fluid">
            <div class="mt-2 bg-light round">
                <div class="px-3 mt-3 mb-3">
                <h1 class="display-4">Electronics</h1>
                    <table>
                        <tr>
                            <th>Inventory #</th>
                            <th>Cost</th>
                            <th>Name</th>
                            <th>Model</th>
                            <th>Wattage</th>
                            <th>Serial #</th>
                        </tr>
                        {
                            data.map((val, key) => {
                                return (
                                    <tr key={key}>
                                        <td>{val.inv_number}</td>
                                        <td>${val.cost.toFixed(2)}</td>
                                        <td>{val.name}</td>
                                        <td>{val.model}</td>
                                        <td>{val.wattage}</td>
                                        <td>{val.serial_number}</td>
                                    </tr>
                                )
                            }
                            )
                        }
                    </table>
                </div>
            </div>
            <form method="post" class="text-center">
                <input type="button" class="my-2 btn btn-primary" name="add-asset" value="Add Asset"></input>
                <input type="button" class="my-2 mx-3 btn btn-danger" name="add-asset" value="Remove Asset"></input>
            </form>
        </div>
    );
}

export default Electronics;
